write a Python program to print out the first 100 prime numbers
Here's an example of how you could write a Python program to print out the first 100 prime numbers using a loop and checking for primality with the Sieve of Eratosthenes algorithm:
```python
def sieve_of_eratosthenes(n):
    # Create a boolean array to store whether each number is prime or not.
    primes = [True] * (n + 1)

    for i in range(2, int(n**0.5) + 1):
        if primes[i]:
            for j in range(i*i, n+1, i):
                primes[j] = False

    return [p for p in range(2, n+1) if primes[p]]

# Print out the first 100 prime numbers.
for num in sieve_of_eratosthenes(100):
    print(num)
